def partition(arr, left, right):
    i = left
    j = right
    pivot = arr[left]
    while i <= j:
        while arr[i] < pivot:
            i += 1
        while arr[j] > pivot:
            j -= 1
        if i <= j:
            arr[i], arr[j] = arr[j], arr[i]
            i += 1
            j -= 1
    return i


def quick_sort(arr, left, right):
    if left < right:
        idx = partition(arr, left, right)
        quick_sort(arr, left, idx - 1)
        quick_sort(arr, idx, right)

